жилая зона индивидуальных (одноквартирных) жилых домов (отдельно стоящих и (или) блокированных) с участками не менее 150 квадратных метров с включением объектов социально-культурного и коммунально-бытового назначения, связанных с проживанием граждан, а также объектов инженерной инфраструктуры.

Цели выделения зоны: 
- развитие на основе существующих и вновь осваиваемых территорий малоэтажной жилой застройки зон комфортного жилья, включающих отдельно стоящие и блокированные жилые дома;
- развитие сферы социального и культурно-бытового обслуживания, обеспечивающей потребности жителей указанных территорий, в соответствующих среде формах;
- создание условий для размещения необходимых объектов инженерной и транспортной инфраструктур.

