Земельные участки условно разрешенных видов использования
могут быть образованы в границах территориальной зоны ТР2, если
максимальная доля таких участков, с учетом образованных земельных участков, от площади указанной территориальной зоны не превысит следующих значений:
при площади до 1 га - 0%;
при площади от 1 до 5 га - 0,5%;
